import React, { Component } from 'react';

import './Experience.css';

class Experience extends Component {
  render() {
    return (
      <div id="experience">
        <h1 className="type-writer">Mes expériences professionnelles</h1>
        <div>
          <ul>
            <li>Stage de 10 semaines de fin de formation DUT chez efluid</li>
            <ul>
              <li>sujet : mise en place d'un système de log dans le moteur d'estimation afin de tracer l'exécution</li>
              <li>Etude comparative afin de choisir le système de log</li>
            le plus adapté
            * Ecriture de test unitaires en java pour prendre
            connaissance des points importants à logger

- Mission d’intérim d'un durée de 2 mois chez efluid suite au stage
           * sujet : approfondissement du sujet du stage
           Réalisation de plusieurs études ayant pour but un
           refactoring du code

- Aide agricole saisonnière (sur 4 ans)
- Travail saisonnier dans une fromagerie (sur 2 ans)
            </ul>
          </ul>
        </div>
      </div>
    );
  }
}

export default Experience;
